import React from 'react';
const Menu = () => {
    return(
        <ul className = 'navBar'>
            <li>Profile</li>
            <li>Messages</li>
            <li>News</li>
            <li>Music</li>
            <li>Settings</li>
        </ul>
    )
}
export default Menu;
